;; **
;;; But for convenience, @@GrapeVine@@ also provides a shortcut symbol **`_`** (underscore), to refer to the "last modified graph". So the following also works:
;; **

;; @@
(hello g0)
(view _)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"419\" height=\"133\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x3b10bb1d \"BufferedImage@3b10bb1d: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@6f8a34df transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 419 height = 133 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x3b10bb1d \"BufferedImage@3b10bb1d: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@6f8a34df transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 419 height = 133 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 419, :height 133})"}
