;; **
;;; # 5. Derivations and History Graphs
;;; 
;;; As explained above, rules are applied to graphs (Grapes) and are used to _derive_ new graphs. This history of __derivations__ of graphs can themselves be represented as a graph, where the nodes represent graphs and edges represent _occurrences_ of graph productions (i.e., rule applications).
;;; 
;;; We define the __history graph__ of a given graph _g_ as the graph that contains all graphs (and derivations) that _g_ depends on or that depend on _g_. 
;;; 
;;; The above definition can easily be extended to _Grapes_ (Graph Enumerations): Since computations with Grapes always start with a Grape that contains a single graph only, the history graph of a Grape is defined as the history graph of the unique original start graph that all graphs in the Grape depend on.
;;; 
;;; We can generate the _history graph_ of a Grape using the `history` form:
;; **

;; @@
(-> (newgrape) hello hello world* vine history view)
