;; **
;;; ## 6.3 Atomic Constraints
;;; 
;;; As described above, atomic constraints have the general form **if @@X@@ then @@C@@**. (Remember that basic constraints are a special case, were the pattern @@X@@ is empty, intuitively: _if TRUE then @@X@@_)
;;; 
;;; Below is an example for an atomic constraint that is _not_ a basic constraint. A graph satisfies this constraint if (and only if) all `Hello` nodes are connected to a `Grape` node by a `to` edge.
;;; 
;;; As we can see, the pattern that belongs to the "if" part is represented in black colour.
;;; 
;; **

;; @@
(cond-constraint if-hello-then-to-grape!
       (IF   (node h:Hello))
       (THEN (node p:Grape)
               (edge :to h p)))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"301\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x357f413d \"BufferedImage@357f413d: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@57dacb51 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 301 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; An empty graph satisfies this constraint:
;; **

;; @@
(-> (newgrape) if-hello-then-to-grape!)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;e43e3e60-2864-478f-bb60-d7f043f3e433&quot;</span>","value":"\"e43e3e60-2864-478f-bb60-d7f043f3e433\""}],"value":"(\"e43e3e60-2864-478f-bb60-d7f043f3e433\")"}
