;; **
;;; # 7. Transactions 
;;; 
;;; The classical notion of transactions revolves around the ACID (atomic, consistent, isolated, durability) properties. 
;;; 
;;; ## 7.1 Durability
;;; 
;;; Since @@GrapeVine@@ uses a database, all graph productions are automatically made durable. However, not all graphs may be of interest. Moreover, identifying graphs with automatically generated IDs is inconvenient. 
;;; 
;;; Graphs can therefore be tagged with semantic names using the `commit` form. In the following example, we tag the resulting graph with the name "_mygraph_"
;;; 
;;; > **Note: `commit` takes a Grape but will commit only the first graph in the enumeration, if there are multiple.**
;;; 
;; **

;; @@
(-> (newgrape) hello world vine)
(commit _ "mygraph")
