;; =>
;;; {"type":"html","content":"<span class='clj-string'>&quot;3ac77499-c7d9-40b4-adf8-429ca976f0f5&quot;</span>","value":"\"3ac77499-c7d9-40b4-adf8-429ca976f0f5\""}
;; <=

;; **
;;; Once tagged, we can simply call the `graph` form to recall the graph by its semantic name, for example:
;; **

;; @@
(-> (grape "mygraph") view)
