;; **
;;; 
;; **

;; **
;;; It should be cleare that the above program does a _breadth-first exploration_ of the possible moves for the ferryman until a solution is found. 
;;; 
;;; What if there _is_ no solution? Let's modify the program and only allow the ferryman to cross _with_ cargo (i.e., no empty ferries). A naive breath-first exploration would run forever, since moves with the goat are always safe but will never achieve the desired solution. The result would be an infinite graph process. The program should never terminate (disregarding resource limitations). Let's try this out:
;; **

;; @@
(-> (newgrape) setup-ferryman
    (->* all_on_the_other_side!
         ferry_one_over*
         wolf-can-eat-goat!-
         goat-can-eat-grape!-))
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[],"value":"()"}
;; <=

;; **
;;; As we can see, the program does indeed terminate and returns an empty grape (no solution). The reason for this is that the @@GrapeVine@@ looping macro compares graphs in the graph process for previously seen graphs and does not further explore graphs that are identical (up to isomorphism) with graphs that have been seen before.
;;; 
;;; Let's have a look at the graph process for the above program:
;; **

;; **
;;; 
;; **

;; @@
(def start (-> (newgrape) setup-ferryman))
(->* start all_on_the_other_side!
         ferry_one_over*
         wolf-can-eat-goat!-
         goat-can-eat-grape!-)
(viewproc start)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"467\" height=\"407\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x78ee658e \"BufferedImage@78ee658e: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@3b57578f transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 467 height = 407 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; Indeed, there are three possible "cargo" moves of the ferry from the initial state. Two of them are "unsafe" and one of the (transporting the goat) is safe. From there, the only possible move is to transport the goat again. At that point, the resulting graph is identical to the start (up to isomorphism). 
;;; 
;;; > *Note: graphs that appear identical (up to isomorphism) are connected with a dashed line to the earlier identical graph in the visualization*
;;; 
;;; Let's look at the graph process of the original program again (which _has_ a solution). Below we see that the breadth-first search does not explore graphs that have already been seen on the process (up to isomorphism).
;; **

;; @@
(-> (newgrape) setup-ferryman
    (->* all_on_the_other_side!
         (|| ferry_one_over* cross_empty*)
         wolf-can-eat-goat!-
         goat-can-eat-grape!-))

(viewproc _)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"768\" height=\"495\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x2cc1d039 \"BufferedImage@2cc1d039: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@3b57578f transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 768 height = 495 #numDataElements 3 dataOff[0] = 2\"]"}
