;; **
;;; If, for some reason, we do not want to limit the application of graph productions to graphs that have already been seen in the graph process (up to isomorphism), we can use the alternative looping macro **(->!*)**. The example below shows that the resulting graph process is significantly larger. 
;;; 
;;; > _Note: this will also take longer... - be patient_
;; **

;; @@
(-> (newgrape) setup-ferryman
    (->*! all_on_the_other_side!
         (|| ferry_one_over* cross_empty*)
         wolf-can-eat-goat!-
         goat-can-eat-grape!-))

(viewproc _)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"768\" height=\"43\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x4a64d673 \"BufferedImage@4a64d673: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@3b57578f transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 768 height = 43 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; Note that using the alternative looping macro (without confluence check) would indeed result in an infinite process when used in the modified program (which only allows ferry crosses with cargo.)
;;; 
;;; ## 8.1. Solving the Ferryman Problem with Invariants
;;; 
;;; Alternatively, we can solve the Ferryman Problem using invariants. We define avoidance of the two dangerous moves as enforced (negative) invariants, and we assert the invariant that a solution cannot be found. We can then use the unconditional looping macro __->**__ since we no longer need the test (it's convered with our assertion.)
;; **

;; @@
(-> (newgrape) 
  (enforce-invariant wolf-can-eat-goat!- goat-can-eat-grape!-) 
  (assert-invariant all_on_the_other_side!-)
  
  setup-ferryman
  
  (->** 
   (|| ferry_one_over* cross_empty*)))
;; @@

;; **
;;; As expected, we get our assertion violated, indicating that there is indeed a solution. The "violating" graph is available in our convienence var **_** (underscore), so we can simply view the process  that let to the violation of the assertion with:
;; **

;; @@
(viewproc _)
